function parseStringToObj(str){

    let prevRef, key, index, arrMatch;

    let split = str.split("=");

    let variableSplit = split[0],
        valueSplit = split[1];

    let keys = variableSplit.split("."),
        keysLen = keys.length;
    if(keysLen === 1){
        key = keys[0];
        arrMatch = key.match(/^(.+?)\[([0-9]+?)\]$/) || [];
        key = arrMatch[1] || keys[0];
        index = parseInt(arrMatch[2] || "-1");
        if(arrMatch.length){
            dataObj[key] = dataObj[key] || [];
            dataObj[key][index] = valueSplit;
        }else{
            dataObj[key] = valueSplit;
        }
    }else{
        for(let i = 0; i< keysLen; i++){
            key = keys[i];
            arrMatch = key.match(/^(.+?)\[([0-9]+?)\]$/) || [];
            key = arrMatch[1] || keys[i];
            index = parseInt(arrMatch[2] || "-1");
            if(i === 0){
                //first key
                if(!dataObj[key]){
                    if(index > -1){
                        dataObj[key] =  [];
                        dataObj[key][index] = {};
                    }else{
                        dataObj[key] =  {};
                    }
                }else if(!dataObj[key][index] && index > -1){
                    dataObj[key][index] = {};
                }
                prevRef = index > -1 ? dataObj[key][index] : dataObj[key];
            }else{
                if(index > -1){
                    prevRef[key] = prevRef[key] || [];
                    prevRef = prevRef[key];
                }else{
                    prevRef[key] = prevRef[key] || {};
                    prevRef = prevRef[key];
                }
                if( i === keysLen - 1){
                    if(index > -1){
                        prevRef[index] = valueSplit;
                    }else{
                        prevRef[key] = valueSplit;
                    }
                }
            }


        }
    }

}
